import React from 'react';
import EmailView from './EmailView';

function Inbox({ emails }) {
  return (
    <div className="inbox">
      <h2>Inbox</h2>
      <ul>
        {emails.map((email) => (
          <li key={email.id}>
            <EmailView email={email} />
          </li>
        ))}
      </ul>
    </div>
  );
}

export default Inbox;
